import React from "react";

const ContactDiv = () => {
    return (
        <table className="contact-list">
            <HeaderInfoLine />
            <InfoLine
                userName={"Judith Williams"}
                email={"judith.williams@gmail.com"}
                companyName={"Google"}
                role={"Designer"}
                forecast={"45 %"}
                date={"Nov 26, 2018"}
            />
            <InfoLine
                userName={"Lindsey Stroud"}
                email={"lindsey.stroud@gmail.com"}
                companyName={"Hatchbuck"}
                role={"Manager"}
                forecast={"50 %"}
                date={"5 Minutes ago"}
            />
            <InfoLine
                userName={"Nicci Troiani"}
                email={"nicci.troiani@gmail.com"}
                companyName={"Slack"}
                role={"Manager"}
                forecast={"75 %"}
                date={"14 Minutes ago"}
            />
            <InfoLine
                userName={"George Fields"}
                email={"george.fields@gmail.com"}
                companyName={"Clockify"}
                role={"CEO"}
                forecast={"10 %"}
                date={"6 Hours ago"}
            />
            <InfoLine
                userName={"Rebecca Moore"}
                email={"rebecca.moore@gmail.com"}
                companyName={"Upwork"}
                role={"Manager"}
                forecast={"25 %"}
                date={"Dec 14, 2018"}
            />
            <InfoLine
                userName={"Jane Doe"}
                email={"jane.doe@gmail.com"}
                companyName={"Trello"}
                role={"Engineer"}
                forecast={"30 %"}
                date={"Dec 12, 2018"}
            />
            <InfoLine
                userName={"Jones Dermot"}
                email={"dermot.jones@gmail.com"}
                companyName={"Slack"}
                role={"Developer"}
                forecast={"40 %"}
                date={"Dec 11, 2018"}
            />
            <InfoLine
                userName={"Martin Merces"}
                email={"martin.merces@gmail.com"}
                companyName={"Google"}
                role={"Manager"}
                forecast={"60 %"}
                date={"Dec 9, 2018"}
            />
            <InfoLine
                userName={"Franz Ferdinand"}
                email={"franz.ferdiand@gmail.com"}
                companyName={"Facebook"}
                role={"Manager"}
                forecast={"100 %"}
                date={"Dec 6, 2018"}
            />
            <InfoLine
                userName={"John Smith"}
                email={"john.smith@gmail.com"}
                companyName={"Skype"}
                role={"CEO"}
                forecast={"75 %"}
                date={"Nov 30, 2018"}
            />
        </table>
    );
}

export default ContactDiv;
